import Link from "next/link";
import { withRouter } from "next/router";

import React from "react";

const NavButton = props => (
    <Link href={props.href}>
        <div
            className={`NavButton ${
                props.router.pathname === props.href ? "active" : ""
            }`}>

        </div>
    </Link>
);

export default withRouter(NavButton);
